class Solution(object):
    def toHex(self, num):
        """
        :type num: int
        :rtype: str
        """

        if num == 0:
            return "0"

        if num < 0:
            num = 2**32 + num

        hex_dict = {10:"a", 11:"b", 12:"c", 13:"d", 14:"e", 15:"f"}
        hex_list = []

        while num > 0:
            rem = num % 16
            if rem < 10:
                hex_list.append(str(rem))
            else:
                hex_list.append(hex_dict[rem])
            num = num // 16

        return "".join(hex_list[::-1])

