    def search(self, nums, target):
        """
        :type nums: List[int]
        :type target: int
        :rtype: int
        """

        # find the pivot
        pivot = self.find_pivot(nums)

        # if the pivot is not found, return -1
        if pivot == -1:
            return -1

        # if the target is less than the first element, search the right side
        if target >= nums[0]:
            return self.binary_search(nums, target, 0, pivot)

        # if the target is greater than the first element, search the left side
        else:
            return self.binary_search(nums, target, pivot, len(nums) - 1)

    def find_pivot(self, nums):
        """
        Find the pivot in the rotated array
        """
        left = 0
        right = len(nums) - 1

        while left <= right:
            mid = (left + right) // 2

            # if the mid element is greater than the next element, it is the pivot
            if nums[mid] > nums[mid + 1]:
                return mid

            # if the mid element is less than the previous element, it is the pivot
            elif nums[mid] < nums[mid - 1]:
                return mid - 1

            # if the mid element is greater than the first element, search the right side
            elif nums[mid] > nums[left]:
                left = mid + 1

            # if the mid element is less than the first element, search the left side
            else:
                right = mid - 1

        return -1

    def binary_search(self, nums, target, left, right):
        """
        Binary search the rotated array
        """
        while left <= right:
            mid = (left + right) // 2

            # if the target is found, return the index
            if nums[mid] == target:
                return mid

            # if the target is greater than the mid element, search the right side
            elif nums[mid] < target:
                left = mid + 1

            # if the target is less than the mid element, search the left side
            else:
                right = mid - 1

        return -1

